import React, {useState, useEffect} from 'react'
import axios from "axios";

let url="https://api.jikan.moe/v3/top/anime";

const Home = () => {

    useEffect(() =>
    {
        fetchData = async () =>
        {
            try
            {
                const res = await axios.get(url);
                console.log(res.data);
            }
            catch(err)
            {
                console.log(err);
            }
        }




    }, [])

    return (
        <div>
            
        </div>
    )
}

export default Home;
